import React from 'react';
import Card from './Card';

const CardList = ({robots}) => {
    const cardArray = robots.map((users,i)=>{
        return <Card 
            key={robots[i].id} 
            name={robots[i].name} 
            username = {robots[i].username} 
            email={robots[i].email} 
            image = {robots[i].image}  />
    })
    return(
        <div>

            {cardArray}

        </div>
    );


}

export default CardList;
